import React from 'react';
import Menu from './components/Menu';
import Intro from './components/Intro';
import About from './components/About';
import Experience from './components/Experience';
import Projects from './components/Projects';

function App() {
  return (
    <div style={{backgroundColor: '#000D18'}}>
      <div className="mx-auto flex w-full" style={{maxWidth: '1200px'}}>
          <div className='static' style={{ width: '1000px', position: 'sticky', top: 0 }} >
            <Intro />
            <Menu />
          </div>
          <div>
            <About />
            <Experience />
            <Projects />
          </div>
      </div>
    </div>
  );
}

export default App;
